import React from 'react'

class Workout extends React.Component {
    state = {
        workouts: []
    }

    componentDidMount = () => {
        fetch("/api/workout")
            .then(res => res.json())
            .then(workouts => this.setState({workouts}))
    }

    render() {
        return (
            <div>
                <h1>Workout hub</h1>
                <p>All Workouts</p>

            </div>
        )
    }
}

export default Workout
